function Users({ userList }) {
  return (
    <div className='Users'>
      <h3>Users</h3>
      <div className='UserList'>
        {
          userList.map((user, index) => {
            <li>{user.username}</li>
          })
        }
      </div>
    </div>
  )
}

export default Users
